Thought:
  Let's simplify the expression by removing the brackets and combining like terms.
  $$
  \begin{aligned}
  \left(x^{2} y-3 y^{2}+5 x y^{2}\right)-\left(-x^{2} y+3 x y^{2}-3 y^{2}\right) &= x^{2} y-3 y^{2}+5 x y^{2}+x^{2} y-3 x y^{2}+3 y^{2} \\
  &= 2x^{2} y + 2xy^{2}
  \end{aligned}
  $$
  Therefore, the answer is C: $2 x^{2} y+2 x y^{2}$.
Action: Answer("C")
